import React from "react";
import "./ListCard.css"
import {Button} from "react-bootstrap"
import {Link} from "react-router-dom"

function ListCard(props){
    const mainStyle = {
        display : "flex",
        justifyContent : "space-between",
        backgroundColor :'white',
        borderRadius : "15px",
        height : "60px",
        boxShadow : "10px 10px 8px 10px #888888;"
    };
    return(
        <div style={mainStyle}>
            <div className="listcard-element">{props.name=="none"?"Name":props.name}</div>
            <div className="listcard-element">{props.org=="none"?"Name":props.org}</div>
            <div className="listcard-element">{props.status=="none"?"Name":props.status}</div>
            <div className="listcard-element">{props.name=="none"?"":<Button variant="primary">View</Button>}</div>
        </div>
    )
}

export default ListCard
